import React from 'react';
import './Shoes.css'; // Import the CSS

const shoesData = [
  {
    id: 1,
    name: 'Nike Mercurial Superfly',
    price: '$120',
    image: 'https://static.nike.com/a/images/c_limit,w_592,f_auto/t_product_v1/a7af1728-0efb-4111-8ed2-816f9e00fb67/ZM+SUPERFLY+10+ELITE+KM+FG.png'
  },
  {
    id: 2,
    name: 'Adidas Predator Edge',
    price: '$110',
    image: 'https://assets.adidas.com/images/w_766,h_766,f_auto,q_auto,fl_lossy,c_fill,g_auto/27dc662c3dc84ad7a0b5aceecb0c2e99_9366/chaussure-predator-languette-rabattue-terrain-souple-multi-surfaces.jpg'
  },
  {
    id: 3,
    name: 'Puma Ultra Ultimate',
    price: '$105',
    image: 'https://images.puma.com/image/upload/f_auto,q_auto,b_rgb:fafafa,w_450,h_450/global/107163/01/sv01/fnd/PNA/fmt/png'
  },
  {
    id: 4,
    name: 'Nike Phantom GX',
    price: '$130',
    image: 'https://static.nik-football-boot-QTV2Jq.png'
  },
  {
    id: 5,
    name: 'Adidas X Speedportal',
    price: '$115',
    image: 'https://assets.adidas.com/images/w_600,f_auto,q_auto/b97a0f94cc0746a1a015af1b00cf255f_9366/X_Speedportal.3_Firm_Ground_Boots_Green_GW8475_01_standard.jpg'
  },
  {
    id: 6,
    name: 'Puma Future Z',
    price: '$100',
    image: 'https://images.puma.com/image/upload/f_auto,q_auto,b_rgb:fafafa,w_450,h_450/global/106989/01/sv01/fnd/PNA/fmt/png'
  },
   {
    id: 7,
    name: 'Nike LeBron 20',
    price: '$160',
    image: 'https://static.nike.com/a/images/t_PDP_1280_v1/f_auto,q_auto:eco/264e93e4-7688-4210-8fcf-12e82c0be252/lebron-xx-basketball-shoes-PG3G3m.png'
  },
  {
    id: 8,
    name: 'Adidas Harden Vol. 7',
    price: '$150',
    image: 'https://assets.adidas.com/images/w_600,f_auto,q_auto/71242ac3de1b4b95a70faef600e9f616_9366/Harden_Vol.7_Basketball_Shoes_Black_IF5616_01_standard.jpg'
  },
  {
    id: 9,
    name: 'Puma MB.02 Rick and Morty',
    price: '$140',
    image: 'https://images.puma.com/image/upload/f_auto,q_auto,b_rgb:fafafa,w_450,h_450/global/378287/01/sv01/fnd/PNA/fmt/png'
  },
  {
    id: 10,
    name: 'Under Armour Curry Flow 10',
    price: '$130',
    image: 'https://underarmour.scene7.com/is/image/Underarmour/3026275-601_DEFAULT?wid=600&hei=600'
  },
  {
    id: 11,
    name: 'Jordan Luka 2',
    price: '$145',
    image: 'https://static.nike.com/a/images/c_limit,w_592,f_auto/t_product_v1/69ff6ed6-9582-4baf-a5e4-19a705c3e515/luka-2-pf-basketball-shoes-dmlcLJ.png'
  },
  {
    id: 12,
    name: 'Nike Zoom Freak 5',
    price: '$135',
    image: 'https://static.nike.com/a/images/c_limit,w_592,f_auto/t_product_v1/9a104209-fb02-43fa-8b25-87002e5bbbe7/zoom-freak-5-basketball-shoes-zf6pDd.png'
  }
];

const Shoes = () => {
  return (
    <div className="shoes-container">
      <h2>Football Shoes</h2>
      <div className="cards-grid">
        {shoesData.map((shoe) => (
          <div key={shoe.id} className="shoe-card">
            <img src={shoe.image} alt={shoe.name} />
            <h4>{shoe.name}</h4>
            <p>{shoe.price}</p>
            <button>Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Shoes;
